import React, { useState } from 'react';
import {  Routes , Route , Link } from "react-router-dom";
import Project1Web from './project1Web';
import Project1App from './project1App';





export default function Project1() {



  return (
    <div className='project1' >
     
        <h1>this is zifcare</h1> 
        <Routes>
        <Route  path="web_version"  element={<Project1Web />} />
        <Route path="app_version"  element={<Project1App />} />
        </Routes>
      
<Link to="/project_zifcare/web_version" >click1</Link>
<Link to="/project_zifcare/app_version" >click2</Link>

      
    </div>
  )
}
